import React, { useState } from "react";
import MuiThemeProvider from "@material-ui/core/styles/MuiThemeProvider";
import AppBar from "@material-ui/core/AppBar";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
{
  /* <Button variant="contained"/> */
}

function StudyDetailsPage() {
  const [studyTitle, setStudyTitle] = useState("");
  const [studyDescription, setStudyDescription] = useState("");
  const [studySummary, setStudySummary] = useState("");
  const [studyType, setStudyType] = useState("");
  const [participantScreening, setParticipantScreening] = useState("");
  const [participantGroup, setParticipantGroup] = useState("");
  const [participantNumber, setParticipantNumber] = useState("");
  const [dataCollected, setDataCollected] = useState("");
  const [studySurvey, setStudySurvey] = useState({});
  const [shipProduct, setShipProduct] = useState("");
  const [studyPayment, setStudyPayment] = useState("");

  return (
    <MuiThemeProvider>
      <React.Fragment>
        <AppBar title="Enter Study Details">Enter Study Details</AppBar>
        <TextField
          helperText="Title for your study"
          label="Study Title"
          style={{ marginTop: 25 }}
          onChange={(e) => setStudyTitle(e.target.value)}
          defaultValue={studyTitle}
        />
        <br />
        <TextField
          helperText="Title for your study"
          label="Study Title"
          style={{ marginTop: 25 }}
          onChange={(e) => setStudyTitle(e.target.value)}
          defaultValue={studyTitle}
        />
        <br />
        <TextField
          helperText="Title for your study"
          label="Study Title"
          style={{ marginTop: 25 }}
          onChange={(e) => setStudyTitle(e.target.value)}
          defaultValue={studyTitle}
        />
        <br />
        <TextField
          helperText="Title for your study"
          label="Study Title"
          style={{ marginTop: 25 }}
          onChange={(e) => setStudyTitle(e.target.value)}
          defaultValue={studyTitle}
        />
        <br />
      </React.Fragment>
    </MuiThemeProvider>
  );
}

export default StudyDetailsPage;
